import React, { Component } from "react";

import FrontPage from "../component/FrontPage";
import FrontPageContent from "../component/FrontPageContent";
import FrontPageContent2 from "../component/FrontPageContent2";

export default class Home extends Component {
  render() {
    return (
      <div>
        <FrontPage />
        <FrontPageContent />
        <FrontPageContent2 />
      </div>
    );
  }
}
